
DROP TABLE IF EXISTS `proposal_masters`;
CREATE TABLE `proposal_masters` (
  `ProposalID` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `UserID` int(11) NOT NULL,
  `ClientID` int(11) NOT NULL,
  `CompanyID` int(11) NOT NULL,
  `LetterID` int(11) NOT NULL,
  `TextID` int(11) NOT NULL,
  `RecommendedCategory` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `RecommendedCategory2` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `DoNotShow` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `DoNotShow2` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `product` text COLLATE utf8mb4_unicode_ci,
  `LastPageProducts` text COLLATE utf8mb4_unicode_ci,
  `Options` text COLLATE utf8mb4_unicode_ci,
  `Options2` text COLLATE utf8mb4_unicode_ci,
  `OtherOptions` longtext COLLATE utf8mb4_unicode_ci,
  `OtherOptions2` longtext COLLATE utf8mb4_unicode_ci,
  `NoiseReduction` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `NoiseReduction2` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `NoiseReductionNote` text COLLATE utf8mb4_unicode_ci,
  `NoiseReductionNote2` text COLLATE utf8mb4_unicode_ci,
  `OptionalEnhancements` text COLLATE utf8mb4_unicode_ci,
  `OptionalEnhancements2` text COLLATE utf8mb4_unicode_ci,
  `MaintenanceSubscribed` enum('YES','NO') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'NO',
  `AdditionalDiscount` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `AdditionalDiscount2` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `is_customDisc` enum('0','1') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '0',
  `is_customDisc2` enum('0','1') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '0',
  `ProposalAddresssInfo` text COLLATE utf8mb4_unicode_ci,
  `ProposalBillingInfo` text COLLATE utf8mb4_unicode_ci,
  `FinancingData` text COLLATE utf8mb4_unicode_ci,
  `ContractFile` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `IsSplitPayment` enum('0','1') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '0' COMMENT '0 for No | 1 for Yes ',
  `InstallationDate` date DEFAULT NULL,
  `InstallationTime` time DEFAULT NULL,
  `ProposalStatus` tinyint(4) NOT NULL DEFAULT '0' COMMENT '0 for Pending | 1 for Purchased | 2 for Draft | 3 for paper sold out',
  `IsExpired` enum('0','1') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT '0' COMMENT '0 for No | 1 for Yes ',
  `signed_attachments` text COLLATE utf8mb4_unicode_ci,
  `SalesTax` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `RemovedProduct` text COLLATE utf8mb4_unicode_ci,
  `EditedProduct` text COLLATE utf8mb4_unicode_ci,
  `ExpiredDate` date DEFAULT NULL,
  `IsCustom` int(11) DEFAULT '0' COMMENT '0 for No | 1 for Yes',
  `CustomLabels` text COLLATE utf8mb4_unicode_ci COMMENT 'Custom estimate labels',
  `CreatedDate` datetime NOT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`ProposalID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

